import { diet, logout } from "../actions/session";


const mapStateToProps = ({ session }) => ({
    session
  });

  const mapDispatchToProps = dispatch => ({
    logout: () => dispatch(logout())
  });

  const [textAddValue, updateInput] = useState("");
  const addNewText = () =>{
    //send form data to server.
    //use library like axios.
    if(!textAddValue){ alert('input empty'); return;}

    fetch('http://localhost:5000/sendText', {
      headers: {
      'Cache-Control': 'no-cache',
      "Content-Type": "application/json",
          'Accept': "application/json",
      },
      method: "POST",
      body: JSON.stringify({text: textAddValue})
    })
    .then(res=>res.json())
    .then(result=>console.log(result))
    .catch(err=>{console.log(err)})
  }

const Login = ({ session }) => {
  console.log(session.userId)
  console.log(session.username)

  const handleSubmit = e => {
    e.preventDefault();
    const user = {
        dietry: e.target[0].value
    };
    const dietry = {
        dietry: e.target[0].value
      };
    diet(user, dietry);
  }


  return (
    <>
    <br/>
    <br/>
    <br/>
    <br/>
    <br/>

      <form onSubmit={handleSubmit}>
        <label>
          Email:
          <input type="username" name="dietry" placeholder="{user.diet}" />
        </label>
        <input type="submit" value="Submit" />
      </form>
    </>
  );
};
export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Login);
